// src/pages/AgendarFicha.js
import React, { useState } from 'react';
import { Button, Form, ProgressBar } from 'react-bootstrap';
import './AgendarFicha.css'; // Asegúrate de crear estilos personalizados

const AgendarFicha = () => {
  const [step, setStep] = useState(1);
  const [formData, setFormData] = useState({});

  const totalSteps = 4;

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const nextStep = () => setStep((prev) => Math.min(prev + 1, totalSteps));
  const prevStep = () => setStep((prev) => Math.max(prev - 1, 1));

  const handleSubmit = () => {
    console.log('Ficha enviada:', formData);
  };

  return (
    <div className="container mt-4">
      <h4>Registrar Ficha Clínica</h4>
      <ProgressBar now={(step / totalSteps) * 100} label={`Paso ${step} de ${totalSteps}`} className="mb-4" />

      {/* Paso 1: Datos del paciente */}
      {step === 1 && (
        <div className="slide-section">
          <Form>
            <div className="row">
              <Form.Group className="col-md-6 mb-3">
                <Form.Label>Nombre</Form.Label>
                <Form.Control name="nombre" onChange={handleChange} />
              </Form.Group>
              <Form.Group className="col-md-6 mb-3">
                <Form.Label>Apellido</Form.Label>
                <Form.Control name="apellido" onChange={handleChange} />
              </Form.Group>
              <Form.Group className="col-md-3 mb-3">
                <Form.Label>Edad</Form.Label>
                <Form.Control name="edad" onChange={handleChange} />
              </Form.Group>
              <Form.Group className="col-md-3 mb-3">
                <Form.Label>Género</Form.Label>
                <Form.Select name="genero" onChange={handleChange}>
                  <option value="">Seleccionar</option>
                  <option>Masculino</option>
                  <option>Femenino</option>
                </Form.Select>
              </Form.Group>
              <Form.Group className="col-md-3 mb-3">
                <Form.Label>Peso (kg)</Form.Label>
                <Form.Control name="peso" onChange={handleChange} />
              </Form.Group>
              <Form.Group className="col-md-3 mb-3">
                <Form.Label>Estatura (cm)</Form.Label>
                <Form.Control name="estatura" onChange={handleChange} />
              </Form.Group>
              <Form.Group className="col-md-6 mb-3">
                <Form.Label>Fecha de nacimiento</Form.Label>
                <Form.Control type="date" name="fechaNacimiento" onChange={handleChange} />
              </Form.Group>
              <Form.Group className="col-md-6 mb-3">
                <Form.Label>Fecha de evaluación</Form.Label>
                <Form.Control type="date" name="fechaEvaluacion" onChange={handleChange} />
              </Form.Group>
              <Form.Group className="col-md-6 mb-3">
                <Form.Label>Escuela</Form.Label>
                <Form.Control name="escuela" onChange={handleChange} />
              </Form.Group>
              <Form.Group className="col-md-3 mb-3">
                <Form.Label>Grado</Form.Label>
                <Form.Control name="grado" onChange={handleChange} />
              </Form.Group>
              <Form.Group className="col-md-6 mb-3">
                <Form.Label>Nombre del tutor</Form.Label>
                <Form.Control name="tutor" onChange={handleChange} />
              </Form.Group>
              <Form.Group className="col-md-3 mb-3">
                <Form.Label>Teléfono</Form.Label>
                <Form.Control name="telefono" onChange={handleChange} />
              </Form.Group>
              <Form.Group className="col-md-3 mb-3">
                <Form.Label>Correo</Form.Label>
                <Form.Control name="correo" onChange={handleChange} />
              </Form.Group>
            </div>
          </Form>
        </div>
      )}

      {/* Paso 2, Paso 3 y Paso 4 se añadirán en siguientes partes */}

      <div className="d-flex justify-content-between mt-4">
        {step > 1 && (
          <Button variant="secondary" onClick={prevStep}>
            Anterior
          </Button>
        )}
        {step < totalSteps ? (
          <Button variant="primary" onClick={nextStep}>
            Siguiente
          </Button>
        ) : (
          <Button variant="success" onClick={handleSubmit}>
            Guardar Ficha
          </Button>
        )}
      </div>
    </div>
  );
};

export default AgendarFicha;
